import './App.css'
import { Component } from 'react'
class App extends Component {
  constructor() {
    super()
    this.state = {
      monsters: [],
    }
  }
  componentDidMount() {
    fetch('https://jsonplaceholder.typicode.com/users')
      .then((response) => response.json())
      .then((users) =>
        this.setState(
          () => {
            return { monsters: users }
          },
          () => {
            console.log(this.state)
          }
        )
      )
  }
  render() {
    return (
      <div className='App'>
        <h1 key={this.state.monsters.id}>{this.state.monsters.name}</h1>
      </div>
    )
  }
}

export default App
